        \       <div style=\"width: 95%; height: 350px; overflow: auto; border: 1px
        solid #dddddd; padding: 3px;\">\n<h3>TERMS AND CONDITIONS</h3>\n<br />\n<strong>General</strong><br
        />\nIf you access this website it is understood that you agree to the following
        terms and conditions:<br />\n<br />\n<strong>Disclaimer</strong><br />\n<div>\nWhile
        reasonable efforts have been made in good faith to ensure the contents of
        this website are factually correct,&nbsp;Waverley Council does not guarantee
        nor accept responsibility or any legal liability whatsoever arising from or
        connected&nbsp;to the accuracy, reliability, currency or completeness of any
        information provided. All of the information provided by or&nbsp;otherwise
        procurable on and from the website is for general information purposes only
        and does not constitute advice&nbsp;whether legal or otherwise from Waverley
        Council. The website is not, and is not intended to be, a substitute or an&nbsp;alternative
        for seeking information by otherwise available statutory means (eg, making
        an application for a planning&nbsp;certificate). Waverley Council does not
        accept any responsibility or legal liability should you rely upon the information&nbsp;provided
        by or otherwise procurable on and from the website to your detriment, except
        as provided by statute. Use of the&nbsp;website and the provision or submission
        of information implies agreement with and consent to these conditions of use.</div>\n<br
        />\n<strong>Copyright</strong><br />\n<div>The contents of this website (which
        includes downloadable material) are subject to copyright and may not be reproduced&nbsp;in
        any form without the prior consent of Waverley Council.</div>\n<br />\n<strong>Laws</strong><br
        />\n<div>All matters relating to this website are governed by the laws of
        the State of New South Wales, Australia and&nbsp;Commonwealth legislation
        if appropriate.</div>\n<br />\n<strong>Request for Access and Acknowledgement</strong><br
        />\n<div>To facilitate access to this information, I request access to the
        information in accordance with the provisions of the&nbsp;Government Information
        (Public Access) Act 2009 and I acknowledge that Council is making the information
        available&nbsp;pursuant to Section 8 of that Act.</div>\n<br />\n<br />\n<h3>APPLICATION
        TRACKING</h3>\n<br />\n<div><em><strong>Application Tracking</strong></em>
        allows you to see the status and follow the progress of the following types
        of applications:</div>\n<br />\n<ol>\n    <li>Development Applications (DA's)</li>\n
        \   <li>Applications to modify development consents (S.96 applications) -
        identified by 'A', 'B', etc after the number</li>\n    <li>Applications to
        review a determination of a DA (S.82A applications) - identified by '1' after
        the number</li>\n    <li>Complying Development Applications (CD's)</li>\n
        \   <li>Tree Applications (TPO's)</li>\n    <li>Footpath Seating Applications
        (FPS's)</li>\n</ol>\n<br />\n<div>Using&nbsp;<em><strong>Application Tracking</strong></em>
        you can access information related to an application online such as:</div>\n<ul>\n
        \   <li>Description of proposal</li>\n    <li>Name of applicant</li>\n    <li>Name
        of Council's Assessment Officer</li>\n    <li>A selection of publicly available
        electronic documents</li>\n    <li>Current status of application including
        tasks that have been completed</li>\n    <li>A decision/determination of the
        application</li>\n</ul>\n<br />\n<div>Please note that&nbsp;<em><strong>Application
        Tracking</strong></em> is only available for applications received after 1
        January 2005. The level of information provided for applications received
        between 2005 and the end of 2010 will be limited. Applications received from
        January 2011 will provide more detailed information. TPO Applications received
        from July 2014 will provide more detailed information.</div>\n<br />\n<div>Application
        Tracking does not list all publicly available information related to these
        applications. Should you wish to view all publicly available documents or
        require additional information, you can contact our Customer Service Centre
        on 9083 8000 or Council&rsquo;s Duty Officer on 9083 8484.</div>\n</div>\r\n
